import { Link } from 'react-router-dom';

function Dashboard() {
    return (
        <>
            <div className="row text-center ">
                <div className="col-2 bg-info text-center">
                    <h3>Admin</h3>
                    <div className="text-center">
                        <nav class="navbar text-center">
                            {/* <div class=""> */}
                            <a className="navbar-brand text-center" href="/">Master</a>
                            {/* </div> */}
                        </nav>
                        <Link to={'/signup'} className='row text-decoration-none'>
                            <button className='btn btn-light'>SignUp</button>
                        </Link>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Dashboard;
